import React from "react";
import Tooltip from './Tooltip';
import '../CSS/Country.css';

const Country = (props) =>{
    return(
        <div>
            <div className="Country">
                <path data-title={props.title} d={props.d}/>
            </div>

            <div className="Tooltip">
                {props.title}
            </div>
        </div>
    )
}

export default Country;
